('21 REALTY Real Estate Experts', '+201272775002', 39, ' soldier ; El Kawthar ; Touristic Center ; Hurghada', NULL),
('21st Avenue Real Estate', '+201000050712', 48, 'الدور الأرضى - عقار ٢ب - شارع ٢١ - سرايات المعادى', 'We know that not just any home will do. Our associates are trained to listen to your idea for your next home and match that with the best-suited inventory on the market. Your time is valuable and we don’t want to waste it.  Whether you’re looking to lease or buy ; our sales professionals have the local market knowledge and expertise to handle all the details of your search and make what is already a stressful time as easy and enjoyable as possible.  21stAvenue employs state of the art marketing tools to get your home top tier exposure to include an online presence complete with floor plans ; virtual tours ; and access to a style consultant to make certain that your home looks it’s very best before going to market. We are your partner in optimizing the sale price of your home.  Contact us to discuss what neighborhood would best fit your needs. Not only can we help you find a place to live ; we can also help ensure that you have a soft landing in our great city.  Call us today or pop by our office to discuss your vision for your next home. We’d be delighted to meet you and explore possibilities over a cup of tea or coffee!\r'),
