('3M international', '+201116661423', 98, 'التجمع الخامس فيلا ٢٨١ المستثمرين الجنوبيه ٤ القاهره الجديده', 'ثري ام انترناشيونال  هدفنا الاول و الاخير راحتك. سواء كنت مالك عقار أو مستأجر أو .مشتري    فإننا نقدر عملك وسنوفر لك الاهتمام الفردي والخدمة التي تستحقها. نحن نؤمن بقواعد أخلاقية صارمة. نحن نؤمن بالنزاهة والالتزام بالتميز والسلوك المهني والرعاية الشخصية.\r'),
('4B Real Estate', '+201064834848', 39, '14 A - 300 new Maadi ', '\"Why 4B Real estate ?  The company was established in 2016 with a professional sales team and trained in international companies. To ensure that the sale ; purchase ; or rental process proceeds professionally ; enjoys transparency and clarity to both parties. We distinguish in 4B Real Estate Marketing that we professional customer service and after-sales services from the unit management for rent on an ongoing basis and write contracts and this is also through a team of professional lawyers also to ensure that the unit is maintained continuously and the right of the customer ; whether you are a first-time buyer or an experienced investor you will find useful information on how to choose the \"\"right property\"\" ; the time of submission of the offer ; and follow-up until a proper and appropriate decision is made. Our goal is to reach the world and spread not only within Egypt but also outside it. Because we will continue to master everything new in real estate. So that we can provide comfort to our valued customers. We dont pretend to be special ; but were after it.\"\r'),
