('ABAZA for real estate', '+201007607215', 49, '292 Banafsg Buildings North 90 StNew Cairo Egypt  ;', 'The Address Real Estate Consultancy is one of the leading real estate companies in Egypt and Middle East with a long-term vision to gain recognition as a trusted brand to ensure major contribution in a healthy developing Real Estate Market.   A renowned group of experts & consultants in the Real Estate field were gathered to bring our clients their dream homes with the luxury of choosing among a variety of different developments ensuring the best deal tailored to suit the budget of our clients.  With an exclusive focus on properties in Egypt and middle east we can effectively turn your real estate dreams and investments into a rewarding reality. The Address Real Estate has been quick to set the quality level of service in Egypt that many other companies fail to achieve.  We take pride in our company and every member of our pro-active team as they pursue and maintain a healthy office atmosphere setting the standard high for all of ‹The Address Family’. This has helped us strategically position ourselves as a trendsetting pioneer in the field of The Real Estate\r'),
('Abo Al Dahab', '+201000602453', 1, 'Madinaty', NULL),
('Abrag Real Estate', '+201001188088', 469, '54 lebanon st  ; Mohandesen ', 'About Us: Abrag Real Estate was founded in 1999 under the name of Engineering Marketing and Management Company (EMMC) based on a solid portfolio & great understanding of the market needs. In 2007 ; the company’s name changed to Abrag Real Estate while promising its customers the satisfaction and the trust they deserve.   Our Services :  Abrag Real Estate offers numerous real estate consultancy services & solutions.  Market survey and studies  Product development  Volume of the market needs and demand  Pricing and Methods of Payment  Marketing Communication plans  Promotions   The company deals with the most reputable real estate developers in the market standing on a solid background while depending on our achievements with most of them.   Our Vision : To be a leading agent for real estate brokerage in Egypt ; MENA region with consistent standards & excellent quality.   Our Mission : In Abrag ; we strive to deliver real estate sales & services including investment consultancy & opportunities with outstanding quality powered by our experts.   Our Values :  Team Work  Trust  Quality  Care\r'),
