('Admiral Real Estate', '+201012155166', 113, '١٨ شارع سمير عبد الرؤف امتداد مكرم عبيد  ; امام البنك الاهلى ', 'The company Admiral Real Estate aims to reach a leading position among the most prominent marketing and real estate investment companies in the Egyptian market and the Middle East. The companys headquarters is located in Cairo and the company is very proud of its youth spirit ; perseverance and the continuous pursuit of excellence ; as well as a constant desire to consolidate long-term relationships with customers And the shareholders ; partners ; and team ; who value their respective roles in consolidating the leading position they occupy today. The vision and mission The vision The company aspires to become the preferred real estate marketer for its various clients and the leading entities in real estate marketing investments in parallel with the firm commitment to achieving career development for all workers and employees. Mission Marketing and presenting the best attractive real estate projects. Maximizing the return on investment for shareholders and protecting the interests of all relevant parties ; in an effort to gain and enhance their confidence in the company\r'),
