('Chance for Realestate', '+201050610189', 16, '١٩ ش بطليموس الفلكي - سابا باشا - الاسكندريه ', 'عايز تبيع / تأجر شقتك ؟  عايز تشتري / تستأجر شقة ؟  إحنا عارفين إن خطوة إتخاذ القرار في الوقت دا بيبقة صعب ودا ليه عدة أسباب  1- عدم ثبات الأسعار في الفترة الحالية.  2 - عدم وجود الخبرة الكافية لتقيم سعر العقار بصورة صحيحة.  3- صعوبة الحصول على عميل جاد بالشراء وإهدار الكثير من الوقت في معاينات ووعود شراء ذائفة.  4 - التخوف من صحة وسلامة مستندات ملكية العقار المراد شراءة.  دي ممكن تكون من أهم الأسباب بجانب أسباب تانية كتير وعشان كدا إحنا في #تشانس موجودين عشان نساعدك في تقيم عقارك بطريقة محترفة ووضع خطط تسويقية ناجحة للعقار عشان نقدر نوصل للعملاء الجادين فعلا في الشراء ودا اللي بيقوم بيه فريق ذو خبرة كبيرة في تسويق وتقيم العقار ودا بيبقة بمثابة مستشارك العقاري.  فريقنا مدرب ومؤهل بقوة للتعامل مع عملائنا بائع / مشتري بصورة إحترافية ودا بيدي فرصة أكبر لنجاح عملية بيع العقار\r'),
