('Darak Madinaty', '+201116574440', 177, 'B15 Arabisc Mall ; Madenty  Cairo Egypt  ;', 'دارك هي إحدى  الشركات الرائدة في مجال التسويق و الاستثمار العقاري في مدينتي و الرحاب و القاهرة الجديدة.  نهدف إلى توفير خدمات شاملة لتلبية احتيجاتكم العقارية من بيع ; شراء ; او استئجار الوحدات العقارية سواء سكنية أو تجارية و نعلم علم اليقين أن الثقة هي العامل الأساسي الذي ينبغي علينا تقديمه لك عندما يتعلق الأمر بشراء أو استئجار أو عرض الممتلكات الخاصة بك للبيع أو الإيجار.   كما نقدم لعملائنا افضل الاستشارات للاستثمار العقاري.  على الهاتف   01140009810                    About Darak for Real Estate in Madinaty     Darak is a real estate consultancy in New Cairo - Madinaty ; who is able to market any property for sale or rent or to invest in                                        the field of real estate  We are working on providing comprehensive services for your real estate needs. If you are willing to make an investment or are interested in buying a residential or a commercial property ;   we are there for you to ensure translating your plans into reality  We have realized through our individual experience among real estate companies in this field in Madinaty and New Cairo that honesty is the real gate to the costumers. We have reached the conclusion that trust is primary factor we should be offering you when it comes to buying ; renting or submitting your  investments\r'),
