('Egypt Best Properties', '+201224946565', 1057, 'District 4 ; Area 5 ; Katameya', 'Who We Are   Egypt Best Properties (EBP) is a real estate marketing company that was established in 2005 by a professional real estate team. For 10 years we have offered excellent services to clients from all over the world and managed a portfolio of properties for a wide range of Egyptian buyers and investors ; international companies ; and local organizations. We serve our clients from four offices covering greater Cairo: Maadi ; New Cairo ; Zamalek ; and 6th October City.   What We Do  EBP is a home and real estate marketplace dedicated to helping homeowners ; homebuyers ; sellers ; renters ; real estate agents ; mortgage professionals ; and property managers find and share vital information about homes ; real estate ; mortgages and home improvement. We are transforming the way consumers make home-related decisions and connect with professionals. It starts with our living database including homes for sale ; homes for rent and homes not currently listed on the market.  Our Vision  To become Egypt’s number one real estate company and act as a benchmark for local and international companies.\r'),
