('ElGammal real estate', '+201222167633', 299, 'قطعة 290 التجمع الخامس شارع التسعين خلف سيراميا كليوباترا', 'تعمل الشركة فى مجال التسويق العقارى والأستشارات العقارية منذ 25 عاما وقد ساهمت الشركة فى العديد من المشروعات الناجحة والمتميزة فى مناطق القاهرة الجديدة   ومصر الجديدة ومدينة نصر  والساحل الشمالى   وقد تم تنفيذ خدمات عقارية متميزة  وبنجاح باهر وبالذات على مستوى الكمبوندات المتميزة وقد ساهمت الشركة فى تقديم الأستشارات العقارية  للعملاء سواء فى البيع والأيجار و الشراء   : ومن أهم هذة الكمبوندا  قطامية هايتس،، قطامية هيلز ،، قطامية ديونز ،، قطامية ريزيدانس ،، ليك فيو ،، سوان ليك ،، الميراج ،، ارابيلا ،، جراند ريزيدانس  ،، وميفيدا ،،ماونتن فيو والخ   وخلاف ذلك تتميز شركة الجمال بوجود بيانات عقارية متميزة وأراضى بمساحات مختلفة  ومبانى ادارية وتجارية  .  وتتميز الشركة بأن لديها قاعدة بيانات عقارية متميزة بالساحل الشمالى من قرى سياحية ومنتجعات متميزة . وهدف الشركة هو الوصول لتلبية طلبات العملاء .  مع تحيات فريق عمل شركة الجمال للتسويق والأستشارات العقارية   ياسر الجمال : 01222167633  محمد البنان : 01274880661  أحمد حسن : 01274880775  ابراهيم خليل :01274933381  هانى الأأنصارى 01211199811\r'),
