('Infinity Investments', '+201119683292', 22, 'The Waterway ; Office AS08 ; Building B1 ; Mohamed Nagib Axis ; New Cairo ; Egypt', 'About Infinity Investments:  INFINITY INVESTMENTS is a real estate development company that combines the accumulated experience of the most professional people in real estate industry ; with the vigorous resources ; knowledge ; and international operations experience of the well-known entity “SKY Group”. SKY Group ; having proven track records in Technology and Telecom solutions in Egypt and in more than 26 other countries over the world has successfully executed more than 3000 value-added projects with 2000 full- time based employees for Multinational as well as National Corporations ; including the latest technology solutions and infrastructure for major real estate projects ; in addition to ; being the sole distributor of EU brands for health & safety equipment ; structured electrical & fiber cabling and data centers PV solar panels & systems and many others.  Our Standards:  Accredited certificates of ISO 9001:2015 for Quality Management and ISO 45001:2018 for Occupational Health and Safety Management  About N Square:  N Square Mall is ideally located in the heart of Narges District in New Cairo. The Mall is the first of its kind in Narges buildings area ; housing commercial spaces including retail stores ; hypermarket ; dining & leisure outlets and much more - All under one roof!  With a built-up area of 8 ;240 sqm ; N Square mall was designed with extreme attention given to details in every corner and its U-shaped design allows a clear view of all stores and outlets.  N Square Mall will include 177 underground parking spaces and a spacious external car parking area of 2 ;700 square meters for up to 100 additional parking spaces.  N Square Mall will serve a current population of over 80 ;000 residents with an expected growth rate in population of %15 per annum in the coming years being centrally located in El Narges District near to:  o Fatma Al Sharbatli Mosque o Al Mustafa Square  o Medical Center  o MASE International School o Monorail Station  The easy access to the Mall ; its location and the collection of stores and outlets appealing to and satisfying different needs of all ages is what will always make N Square Mall the customer’s first choice!\r'),
