('Inspectors Real Estate Consultancy', '+201009104100', 67, 'Villa 107 2nd Neighborhood ; 5th zone front of air force hospital  ;90th Street', 'The mission of Insepctors is to be the most successful real estate firm   in Egypt  Seeking a dynamic and professional environment to work in which will   facilitate my personal development in a career suited to my talents   developed throughout my years of working in residential and commercial   real estate. Upon working for a company of such a nature ; I am a   dedicated and motivated individual which translates into meeting the   goals of the firm. I also aspire to develop within the company and be   provided with the opportunities to grow and establish a long term career   path.   We present Full real estate service that offer our clients property   management services in addition to leasing  ; insurance ; brokerage  ;   sales  ; counseling  ; appraisal  ; financing and mortgage banking.   Advise clients on market conditions ; prices ; mortgages ; legal   requirements and related matters.   Dealing with the biggest Developers in Egypt and Middle East.   Dealing with projects only (Prime & resale)   Answer clients​ questions regarding construction work ; financing ;   maintenance ; repairs ; and appraisals.   Review plans for new construction with clients ; enumerating and   recommending available options\r'),
