('Iskan', '+201000053016', 221, 'Building 1 office 1302 third floor park street - El Sheikh zayed', 'Iskan Real Estate is a leading real estate agency and information hub that serving millions of  seekers looking for Residential ; Commercial and Administrative properties.   Iskan providing you solutions whether for buying ; selling ; renting ; learning ; or investing  ;we provides you with a fast and easy search experience ; and arms you with the information and consultations  you need to take on your real estate goals.  Iskan Real Estate launched in 2020 for providing appropriate solutions and consultations with experience more than 10 years in real estate field by the best real estate professional property consultants.   إسكان هي وكالة عقارية رائدة ومركز معلومات يخدم ملايين الباحثين عن العقارات السكنية ; التجارية و الادارية.   أسكان توفر لك الحلول سواء كنت تشتري ; تبيع ; تستأجر ; تتعلم أو تستثمر، فإننا نقدم لك تجربة بحث سريعة وسهلة و نزودك بالمعلومات والاستشارات التي تحتاجها لتحقيق أهدافك العقارية.  تم إطلاق شركة إسكان العقارية في عام 2020 لتقديم الحلول والاستشارات المناسبة بخبرة تزيد عن 10 سنوات في مجال العقارات على أيدي أفضل مستشاري العقارات المحترفين.\r'),
