('lacerta properties', '+201010591385', 125, 'NEW CAIRO', 'شركة Lacerta لللاستشارات العقارية تقدم لك صفوة المستشاريين العقاريين خبرة اكتر من 10 سنين   في مجال الاستشارات والاستثمار العقاري وخدماتنا بدون اي  عمولات نهائيا   نحن نقدم لك الاستشارة مجانا في وجود العديد من المشاريع والفرص الاستثمارية الواعدة سواء سكني او تجاري في  كل من (العاصمة الادارية - التجمع الخامس - اكتوبر - الساحل الشمالي - مدينة الجلالة - والعين السخنة ) وغيرهم كثرة المشاريع والشركات قد تجعلك  في حيرة كبيرة في اختيار المشروع الامثل لك سواء سكني او تجاري او اداري فربما تتسائل اي المشاريع ارخص في سعر المتر ومن الافضل في انظمة السداد ومميزات وعيوب الموقع على ارض الواقع واين توجد الفرص المثالية نحن موجودين لخدمتك وتقديم النصيحه لك مجانا\r'),
