('Location for Real Estate', '+201015514400', 161, '1 B El Nozha St. Nasr City Cairo Egypt.', 'Our Vision :  Location Real Estate Investment & Marketing is an Egyptian company established in 2015 with the aim of providing real estate services in various areas including residential and commercial projects.  In 2017 we achieved about 400.000.000 LE sales volume in primary projects only without resale and commercial sales. In 2018 we aim to achieve 1 billion LE in all real estate services in the Egyptian market.  Our vision in the next five years to become one of the best brokerage companies in the Egyptian market and Arab world.  Our Mission :  We have brought together a group of trusted real estate developers to present the most outstanding projects that these developers have under one roof.   We deal with each other as one family. We are united with our customers such as that our attitudes and aspirations can be of mutual benefit to both parties involved.  We treat all our customers fairly and without discrimination in order to gain their trust and thus we shall always be their first choice for investments in the future ( We build trust ).  Our Team :  We have provided a number of professional real estate consultants to help clients make the right purchasing decision ; all with the same price without taking any commission from the buyer and without any administrative expenses.   Sales Team force now : 10 and we are expanding\r'),
