('Meeza for Realestate', '+201022421334', 186, '٥٣ ش فيكتور عمانويل امام باب مول زهران ', 'شركة ميزة للتسويق العقارى والتشطيبات واعمال الديكور  خبرة طويلة فى عالم العقارات  متعاقدين مع أكبر شركات فى مجال التعمير والانشاءات مثل السعودية المصرية للتعمير والغنيمى   و V development لتسويق مشاريعهم فى العاصمة الإدارية والعلميين الجديدة وصوارى ومرووج وغيرهم  مهندسين ديكور لهم سابقة اعمال متميزة  تليفون  أرضى               :  034200385  موبايل / واتس  :  01022421334  ايميل :                                     meezars@outlook.com       اسكندرية - سموحة  ٥٣ شارع فيكتور عمانويل  الدور الأول  امام مدخل مول زهران مباشرة  ويمكنكم مراجعة بيدج الشركة على الفيس بوك بالبحث عن  meeza realestate  يسعدنا تشريفكم لنا فى مقر الشركة حيث لدينا عروض عديدة لبيع وشراء وتأجير الوحدات السكنية والعقارية المختلفة\r'),
