('RCR for real estate', '+201007111169', 47, 'Alex', '\"Ready To Find Your Home Today ?  Since 2018 ; RCR  ; Realtors has grown into one of the nations leading providers of homeownership services by putting our customers first.  Today ; we take the most pride in our ability to go beyond \"\"full service.\"\" For example ; no one can match our ability to market homes through our unique contact center responds to website visitors requests for information by connecting them to a local Sales Associate within minutes; other companies take up to 24 hours or more. Even more importantly ; the neighborhood knowledge and personal attention of our friendly Sales Associates can help you realize your dreams.  In recent years ; weve responded to the changing needs and concerns of people like you by turning RCR sales office into true \"\"one-stop\"\" destinations for the full range of real estate products and services. Unlike many of our competitors who claim to offer this service but only have an 800 number for you to call ; we have a RCR Services Manager you can meet in your local RCR office. He or she has the expertise to provide solutions and advice and to streamline the delivery of homeowners and even assist with the many details of moving.\"\r'),
