('Reec Home', '+201288886664', 271, '3 حسن صادق، مصر الجديدة ', '\"The Real Estate Egyptian Center (REEC HOME) company is a limited liability company (L.L.C) established in 2002. We offer a complete portfolio of real estate services ; including sales and leasing of residential and commercial property ; project sales and marketing ; property consultancy ; interior decoration & design ; relocation services. And resale residenfial and commercial units we conduct research studies and valuation surveys upon request. REEC HOME also advises individuals and corporate on growth strategies and real estate investment opportunities in current and new markets.  The Real Estate Egyptian Center (REEC HOME) offers:  -Villas and apartments in all locations in Egypt for every budget ; for leasing or for sale.  -	exceptional commercial property in all locations.  -	property management.  -	Maintanance for all types of properties.\"\r'),
