('Reportage Egypt', '+201025122128', 30, 'The WaterWay ; Mohammed Naguib ; B1 Office BF06 ; New Cairo - Egypt', 'Reportage properties is an Emirati company ; and it’s considered one of the largest real estate companies with a headquarters in Abu Dhabi. Reportage has established its branch in Egypt and launched its first projects on Egyptian soil in Mostakbal City ; among the recent attractive spots in New Cairo.  The company has more than 20 years of experience. It aims to provide realty solutions and offer a high-end residency with competitive and affordable prices. Reportage collaborated with “Al Ahli Sabbour” real estate development company to present the “Montenapoleone” compound as its first residential project in Egypt.  A group of shareholders with over 30 years of experience in real estate development teamed up and founded Reportage Property to begin development prosperity.  The company is always obligated to deliver projects on time as scheduled because our commitment is the essence of trust and reputation.  Reportage Properties’ portfolio in the UAE includes:  Leonardo Residence in Masdar City  Al Raha Lofts 1 in Al Raha Beach  Al Raha Lofts 2 in Al Raha Beach  Oasis Residence 1 Masdar City.  Oasis Residence 2 Masdar City.  Al Maryah Vista on Maryah Island  The Gate in Masdar City  Rakan Tower in Dubai  Rakan 2 Lofts in Dubai  Alexis Tower in Jebel Ali  Diva on Yas Island ; Abu Dhabi  Finally ; we launched “Montenapoleone” in Egypt under the name of Reportage Egypt in collaboration with Al Ahli Sabbour. Montenapoleone is designed in the Italian style and maintains all the services needed by the residents. Furthermore ; it includes all the elements of elegance to make the compound such a unique opportunity of beauty and elegant residency and a brilliant investment.\r'),
