('Roots Real estate', '+201115611103', 75, '١٩١ شقه رقم ١٩ شارع العروبه مصر الجديده', 'ROOTS real estate provides a wide range of services ; we can list your property for sale and represent you in the purchase of any real estate. Our experience makes the selling and buying properties easy and smooth transactions for you ; familiarity with the market is necessary to Buy/Sell your property effectively; moreover ; we have the experience & knowledge of the always changing market to select the advertising mediums that are just right for your property either to Buy or to Sell.  ROOTS real estate is specialized in properties ; advising clients on the finest residential sales ; rentals ; investments and new developments in Greater Cairo.  So give us a call and let us handle your next real estate transaction!\r'),
