('The Advisor', '+201200111370', 49, 'Al Ouroba Palace building 23 Fawzi Moaaz st. Smouha ; Alexandria ', 'Who are we ?  The Advisors consulting agency is a full team of real estate experts seeking to help you reach your goals. Whether it’s for investment or a new home ; The advisors team will facilitate all the knowledge and guidance for you to find the most trusted and popular projects all over Egypt in the real estate market. We make it easier for you to choose what satisfies your needs. Simply ; The Advisors can handle things for you the right way.   OUR VISION  To become the leading real estate consulting agency in Egypt providing high class real estate services that meet our clients’ needs at all times.  What we do    Professional experts in the real estate market with a clear vision of what needs to be done with an intelligent know how.  Offer positive advice for positive people.  The Advisors team provides a full market view for buyers and investors in real estate market sectors such as residential ; commercial and vacations homes.  We provide the best customer experience in buying from a variety of projects in elite locations in  Alexandria ; North Coast ; New Cairo ; New Capital ; New Alamin ; 6October ; Shaikh Zayed City ; Hurghada ; Ain Sokhna ; El Gouna.   What we offer to our clients :  Providing the best opportunities for investment in the Egyptian real-estate market.  With 12 years’ experience in the field supported by academic background and a full knowledge of the Egyptian market managed by professional real-estate advisors that can help you make the right decision.  Providing services in the following locations:  Alexandria  Greater Cairo  New Cairo  New Capital  6 Of October City  Sheikh Zayed City  New Alamin City  ;  Hurghada  So ; when you come to us for advice ; you become a part of our family.\r'),
